import React from 'react';

const Form = () => {
    return ( 
        <form>
            <div>
                <label>Ingresa el pokemon a buscar</label>
                <input
                    type="text"
                    placeholder="Ingresa el nombre de un pokemon"
                />
            </div>
        </form>
    );
}
 
export default Form;
